import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import './App.css';

function App() {
  return (
    <Router>
        <div className="App">
            <div className="container py-3">
                <Switch>
                    <h1>Hello World</h1>
                </Switch>
            </div>
        </div>
    </Router>
  );
}

export default App;
